import java.beans.PropertyChangeListener;
import java.beans.PropertyChangeSupport;

public abstract class AModel implements IModel {

	PropertyChangeSupport propertyChangeSupport = new PropertyChangeSupport(this);

	protected Integer distance;
	protected Integer duration;
	protected Integer exhalation;
	protected Boolean isSafe;


	protected AModel() {
		// do nothing
	}

	public void setSafety(Integer distance, Integer duration, Integer exhalation) {
		Integer old_distance = this.distance;
		Integer old_duration = this.duration;
		Integer old_exhalation = this.exhalation;
		Boolean old_safe = this.isSafe;

		this.distance = distance;
		this.duration = duration;
		this.exhalation = exhalation;
		Boolean safe = isSafe();

		propertyChangeSupport.firePropertyChange(DISTANCE, old_distance, distance);
		propertyChangeSupport.firePropertyChange(DURATION, old_duration, duration);
		propertyChangeSupport.firePropertyChange(EXHALATION, old_exhalation, exhalation);
		propertyChangeSupport.firePropertyChange(SAFE, old_safe, safe);

		resetProperties();
	}

	@Override
	public int getDistance() {
		return distance;
	}

	@Override
	public int getDuration() {
		return duration;
	}

	@Override
	public int getExhalation() {
		return exhalation;
	}

	public void resetProperties() {
		this.distance = null;
		this.duration = null;
		this.exhalation = null;
		this.isSafe = null;
	}

	@Override
	public void addPropertyChangeListener(PropertyChangeListener listener) {
		propertyChangeSupport.addPropertyChangeListener(listener);	
	}

	@Override
	public abstract boolean isSafe();


}

